      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col0 * col1 * + col0 / + + 41 BETWEEN - col0 * + - col1 AND 6 / 30 - + col1 / + col2 * - col1 - + col2;
  - name: tab2

outputs:
  - name: q5651.out
    data: |
      46	51	23
      64	77	40
      75	67	58
